import React from "react";
import style from "./User.module.css"

const User = (props) => {
    return (
        <div className={style.user}>
            <img src={props.avatar}/>
            <div> {props.name}</div>
            <div> {props.country}</div>
            <div> {props.city}</div>
            <div>{ props.followed ? <button onClick={props.follow}> Follow</button> :
                <button onClick={console.log("Unfollow")}> Unfollow</button>}</div>
        </div>
    )
}

export default User
